import React from "react";
import './Btn.css';

const BtnWild = () => {
  return (
    <div className="CercleBtn">
        <a
          href="https://www.linkedin.com/in/victor-veyrier-ab6948194"
          target="_blank"
          rel="noopener noreferrer"
          className=""
        >
        <img
          src="https://user-images.githubusercontent.com/57908921/85471152-54374000-b5b0-11ea-9950-ca2b981eabac.png"
          alt="ImgWild"
          className="ImgWild"
        />
        </a>
    </div>
  );
};

export default BtnWild;
